<html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
<title><!--TITLE--> BOM - Rev <!--REVISON--></title>
<style>
body
{
    background-color: #ededed;
    min-width: 842px;
	font-family: Arial, Helvetica, sans-serif;
}

#BOMInfoID
{
    padding: 15px;
   /* display: inline-block; */
    background-color: #e0f0ff;
    border-radius: 5px;
    margin: 5px 25px 5px 25px;
}

br.clear
{
    clear: both;
}

hr
{
    border: 0;
    height: 0;
    border-top: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 1px solid rgba(255, 255, 255, 0.3);
}

.group, .Header, .group_head{
    width:100%;
}

.column, .Head{
    float: left;
    width: 140px;
    height: auto;
    text-align: left;
    margin: 5px 5px 5px 15px;
}

.column{
    float: left;
	font-family: Consolas, "Lucida Console", Monaco, monospace;
	font-size: 0.8em;
    height: auto;
    text-align: left;
    margin: 5px 5px 5px 15px;
    width: 140px;
}

.HeadQtyTag{
    width: 20px;
}

.HeadValueTag{
    width: 100px;
}

.HeadFootprintTag{
    width: 100px;
	text-overflow: ellipsis;
    white-space: nowrap;
    overflow: hidden;
    text-align: right;
    direction:rtl; 
    margin-left:15px;
}

div.Head:nth-child(5){
    width: 175px;
}
.Field_Description{
    width: 175px;
}

.partRow{
    display: table;
    font-size: 14px;
     width: 100%;
}
.group .partRow:hover{
    background-color: #ededed;
}
#TableId{
    background-color: white;
    width: 1300px;
    margin: 0 auto;
    border-radius: 5px;
    box-shadow: 0 10px 50px rgba(0,0,0,0.2);
}
.footer
{
    padding:5px;
    text-align: center;
}

.footer,
.Header,
.group_title,
.Head
{
    color: #444;
    display: block;
    font-size: 0.5em;
    text-decoration: none;
}

.Header h1
{
    color: #000;
	font-family: Roboto, Arial, Helvetica, sans-serif;
    font-size: 35px;
    text-transform: uppercase;
    float: left;
    width: 60%;
    margin: 25px 15px 15px 25px;
}
.Head{
    font-size: 16px;
	font-weight: bold;
}
.group_title{
    text-align: center;
    font-size: 1.2em;
	margin: 10px;
}
.group_C:after{
    content:"Capacitors";
}
.group_D:after{
    content:"Diodes";
}
.group_F:after{
    content:"Fuse";
}
.group_J:after{
    content:"Jumpers/Connectors";
}
.group_L:after{
    content:"Inductors";
}
.group_P:after{
    content:"Connectors";
}
.group_CN:after{
    content:"Connectors";
}
.group_Q:after{
    content:"Transistors";
}
.group_R:after{
    content:"Resistors";
}
.group_RV:after{
    content:"Varistors";
}
.group_U:after{
    content:"Semiconductors";
}
.group_SW:after{
    content:"Switches";
}
.group_IC:after{
    content:"Integrated Circuit";
}
.group_V:after{
    content:"Varistors";
}
.group_X:after{
    content:"Crystals";
}
.group_Y:after{
    content:"Crystals";
}
.group .group_title{
    color: #444;
}
/*image what convert to css uri at http://www.askapache.com/online-tools/base64-image-converter/ */
#logo { 
	background-image: url("data:image/;base64,");
    width: 335;
    height: 137;
    display: inline-block;
    float: right;
    margin-top: 45px;
    margin-right: 120px;
    background-size: contain;
}
</style>
</head>
<body>
    <div id="main">
        <div id="TableId">
            <div class="Header"><h1><!--TITLE--><br>BOM Rev <!--REVISON--></h1> <div id="logo"></div></div>
            <div id="BOMInfoID">
                <span class="title-block">Date: <!--DATE--></span>
                <span class="title-block">Company: <!--COMPANY--></span>
                <span class="title-block">Comment 1: <!--COMMENT_1--></span>
                <span class="title-block">Comment 2: <!--COMMENT_2--></span>
                <span class="title-block">Comment 3: <!--COMMENT_3--></span>
                <span class="title-block">Comment 4: <!--COMMENT_4--></span>
                <span class="title-block">Total Parts: <!--TOTAL_NUM_OF_PARTS--> (Unique: <!--TOTAL_NUM_OF_UNIQUE_PARTS-->)</span>
            </div>

            <div class="group_head"><div class="partRow"><!--CLASS_HEADER_TAG--></div></div>
            <!--BOM_TABLE-->
            <hr>

            <div class="group footer"><h1>BOM made with <a href="https://github.com/HashDefineElectronics/KiCad_BOM_Wizard">KICAD_BOM_WIZARD</a><br>(Generated <!--DATE_GENERATED-->)</h1></div>
        </div>
    </div>
</body>
</html>
